import React from "react"


class AppTitle extends React.Component {


    constructor(props) {
        super()
        this.state = {
            players: [],
            games: []
        }
    }

    componentDidMount() {
        fetch('/api/players')
            .then(res => res.json())
            .then(players => this.setState({players: players.playerStatsTotals}))

        fetch('/api/schedule')
        .then(res => res.json())
        .then(games => this.setState({games: games.game}))


    }

    render() {
        const { players } = this.state;
        const { games } = this.state;
        console.log(games.awayTeam.abbreviation)
        return (
            <div>
                <ul>
                    {players.map(player =>
                    <li key={player.player.id}>
                        <p>{player.player.firstName} {player.player.lastName}</p>
                    </li>
                    )}
                </ul>

                <ul>
                <li key={games.id}>
                        <p>{games.scoring.awayScoreTotal}</p>
                    </li>
                </ul>
            </div>

        );
      }



}

  export default AppTitle
